/* src/components/pages/HomePage/HomePage.js */
import React from 'react'
import Header from '../../layout/Header'
import './HomePage.css';

function HomePage() {
  return (
    <div className="HomePageMain">
      <Header />
      <div>Welcome!</div>
      <div>This is the home page.</div>
    </div>
  )
}

export default HomePage
